import React from 'react';
import "./Inicio.css";
import Menu from "../../Menu";
import Header from '../../Header';
import Calendar from './Calendar';
import Widget from '../widgets/widget-1/Widget';
import "../../Fonts.css";
// ...código anterior omitido para concisão

const Inicio = () => {
  const colorCode = 0; // O valor de colorCode será alterado conforme situação da consulta (0 / verde = confirmada, 1 / cinza = pendente e 2 / rosa = cancelada)

  return (
    <div className="container">

      <div className="item item1-2"><Header/></div>
      <div className='item item 3'><Widget/></div>
      <div className="item item2"><Calendar colorCode={colorCode} /></div>
      
    </div>
  );
};

export default Inicio;
